import { Route, Switch } from "react-router-dom";
import Footer from "./Componets/Footer/Footer";
import Header from "./Componets/Header";
import Home from "./Containers/Home/Home";

function App() {
  return (
      <>

                <Switch>
                          <Route exact path={"/"}component={Home}/>
                </Switch>

              <Footer/>  
      </>
  );
}

export default App;
